import React from 'react'
const Card = (props) => {
  return (

    
      <div className="col-4">
        <img
          className='text-center'
          src={props.img}
          alt=""
          
        />
        <h2 className='text-center'>
          {props.title}
        </h2>
        <p className='text-center'>
          {props.soustitle}
        </p>
        <h6 className='text-center'>{props.signature}</h6>

      </div>
    




  )
}

export default Card
